(24, NULL, 4, 16, NULL, 'Jalebi Morning', '🌞 Sweet Sunrise Delights: Jalebi Morning Show Extravaganza! 🌞  Indulge your senses in a swirl of sugary splendor at our enchanting \"Jalebi Morning Show,\" where the magic of dawn meets the delectable world of sweet temptations! Join us for a morning filled with laughter, joy, and the irresistible aroma of freshly made jalebis.', 'Upcoming', '2024-01-20', '2024-01-25', NULL, NULL, NULL, NULL, NULL, 'jalebi_morning_tour.jpg', 0, 1, '2023-12-11 20:49:56'),
(28, 24, 2, 16, NULL, 'Jalebi Morning Day 1', '🌞 Sweet Sunrise Delights: Jalebi Morning Show Extravaganza! 🌞\r\n\r\nIndulge your senses in a swirl of sugary splendor at our enchanting \"Jalebi Morning Show,\" where the magic of dawn meets the delectable world of sweet temptations! Join us for a morning filled with laughter, joy, and the irresistible aroma of freshly made jalebis.', 'Upcoming', '2024-01-23', '2024-01-23', '13:57:00', '07:03:00', 0, 'Karachi', 600, 'jalebi_morning_tour.jpg', 0, 1, '2023-12-11 20:58:04'),
