(41, 40, NULL, 14, NULL, 'Train The Trainer', 'A Train the Trainer program is about training new and inexperienced instructors. Sometimes, train the trainer sessions are appropriate for existing instructors as well. These courses cover the best way to deliver training materials to other groups of learners.', 'Completed', '2024-01-25', '2024-01-25', '01:00:00', '03:43:00', NULL, 'Islamabad', 70, 'train_the_trainer_program_-_registration.jpg', 0, 1, '2023-12-12 09:44:07'),
(53, NULL, 7, 14, NULL, 'NEUPLEX CINEMA', 'Neuplex Cinemas is a contemporary cinema chain with multiple locations in major cities across Pakistan, including Karachi. The chain is known for providing a modern and comfortable cinematic experience, featuring state-of-the-art facilities and technology.', 'Upcoming', '2024-01-09', '2025-01-10', NULL, NULL, NULL, NULL, NULL, '586cc07fce4ba.jpg', 0, 1, '2024-01-08 20:53:27'),
(54, NULL, 8, 14, NULL, 'Sindh Premier League', 'The Sindh Premier League (SPL) is a professional Twenty20 cricket league in Pakistan. It was established in 2023, and it has become one of the premier T20 leagues in the world. ', 'Upcoming', '2024-01-10', '2024-01-25', NULL, NULL, NULL, NULL, NULL, 'white-border-SPL.png', 0, 1, '2024-01-08 20:55:27'),
(55, 53, 7, 14, NULL, 'Tiger 3', 'Tiger 3: Directed by Maneesh Sharma. With Salman Khan, Katrina Kaif, Emraan Hashmi, Simran. Tiger and Zoya are back - to save the country and their family.', 'Upcoming', '2024-01-13', '2024-01-09', '15:00:00', '18:00:00', NULL, 'Shaheed e Millat Road Karachi', 96, 'tiger-3---salman-khan-katrina-kaif5f98ada026f56f7f9f64ff0e00090313.jpg', 0, 1, '2024-01-08 21:03:50'),
(56, 54, NULL, 14, NULL, 'KHI vs HYD ', 'The SPL is more than just a cricket league; it is a cultural extravaganza that embodies the rich history and diversity of the province.', 'Upcoming', '2024-01-10', '2024-01-10', '08:10:00', '14:10:00', NULL, 'Karachi stadium shah re faisal', 12000, '5c7396797907d.png', 0, 1, '2024-01-08 21:11:54'),
(57, 54, NULL, 14, NULL, 'SUK vs KHI', 'The SPL is more than just a cricket league; it is a cultural extravaganza that embodies the rich history and diversity of the province.', 'Upcoming', '2024-01-11', '2024-01-11', '17:00:00', '22:00:00', NULL, 'Hyderabad national stadium near shahi Qila', 12000, '5c7396797907d.png', 0, 1, '2024-01-08 21:13:39');
